import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faSearch, faEnvelope, faBell } from '@fortawesome/free-solid-svg-icons';

const Notificationbar = () => {
  return (
    <Router>
      <div className="container">
        <nav>
          <ul>
            <li>
              <Link to="/">
                <FontAwesomeIcon icon={faHome} className="icon" />
                Home
              </Link>
            </li>
            <li>
              <Link to="/search">
                <FontAwesomeIcon icon={faSearch} className="icon" />
                Search
              </Link>
            </li>
            <li>
              <Link to="/mailbox">
                <FontAwesomeIcon icon={faEnvelope} className="icon" />
                Mailbox
              </Link>
            </li>
            <li>
              <Link to="/notifications">
                <FontAwesomeIcon icon={faBell} className="icon" />
                Notifications
              </Link>
            </li>
          </ul>
        </nav>

        <hr />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/search" element={<Search />} />
          <Route path="/mailbox" element={<Mailbox />} />
          <Route path="/notifications" element={<Notifications />} />
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => (
  <div>
    <h2>Home</h2>
    <p>Welcome to the landing page!</p>
  </div>
);

const Search = () => (
  <div>
    <h2>Search</h2>
    <p>Search functionality will be implemented here.</p>
  </div>
);

const Mailbox = () => (
  <div>
    <h2>Mailbox</h2>
    <p>Mailbox functionality will be implemented here.</p>
  </div>
);

const Notifications = () => (
  <div>
    <h2>Notifications</h2>
    <p>Notifications functionality will be implemented here.</p>
  </div>
);

export default Notificationbar;
